//do nothing until things are setup
let setupYet = false

//GLOBAL INFO

//site arrays
const workSiteArr = ["indeed.com"]
const funSiteArr = ["twitter.com"]

//annoy counters
let numWorkAnnoy = 0
let numFunAnnoy = 0

//health/POS mode
let healthMode = false

//interval (default to 10s)
let useInterval = 100000



//check every random interval whether someone is on a page in the list

const checkAndAnnoy = () => chrome.tabs.query({active: true, lastFocusedWindow: true}, tabs => {
    console.log("this is tabs", tabs)
    let url = tabs[0].url;
    //set checking Value of url
    let workIncludesCheck = false
    let funIncludesCheck = false

    //check if any URLS match
    workSiteArr.forEach(el =>{
        if (url.includes(el)) workIncludesCheck = true
    })
    
    funSiteArr.forEach(el =>{
        if (url.includes(el)) funIncludesCheck = true
    })

    if (workIncludesCheck) {
        numWorkAnnoy++
        numFunAnnoy = 0
        chrome.scripting.executeScript({
            target: { tabId: tabs[0].id },
            func: workInjectedFunction,
            args: [healthMode, numWorkAnnoy],
        });
    }

    if (funIncludesCheck) {
        numFunAnnoy++
        numWorkAnnoy = 0
        chrome.scripting.executeScript({
            target: { tabId: tabs[0].id },
            func: funInjectedFunction,
            args: [healthMode, numFunAnnoy],
        });
    }

    annoyInterval()
});

