chrome.runtime.onMessage.addListener(messageReceived);
function messageReceived(msg) {
    console.log("message: ", msg)
    const { setup, newURL , funWork, pos, int } = msg
    if (setup) {
        setupYet = true
        annoyInterval()
    }
    if (funWork === "work") {
        workSiteArr.push(newURL)
    }
    if (funWork === "fun") {
        funSiteArr.push(newURL)
    }
    if (pos === "Health") {
        healthMode = true
    }
    if (int) {
        useInterval = int*1000
    }
}

